import Characters from '../db/Character/Character';

function CHA() { 
  return (
    <div className="">
      <>
      <h1>Who lives in my garage?</h1>
      <ul>
        {Cha.map((car) => <Car brand={car} />)}
      </ul>
    </>
    </div>
  );
}
export default CHA;
